class Solution(object):
    def maximumRemovals(self, s, p, removable):
        """
        :type s: str
        :type p: str
        :type removable: List[int]
        :rtype: int
        """

        def check(mid, s, p, removable, isRemoved):
            for i in xrange(0, len(s)):
                isRemoved[i] = False
            for i in xrange(0, mid):
                isRemoved[removable[i]] = True
            i, j = 0, 0
            while i < len(s) and j < len(p):
                if isRemoved[i]:
                    i += 1
                    continue
                if s[i] == p[j]:
                    j += 1
                i += 1
            return j == len(p)

        isRemoved = [False] * len(s)
        l, r = 0, len(removable)
        while l < r:
            mid = (r + l + 1) >> 1
            if check(mid, s, p, removable, isRemoved):
                l = mid
            else:
                r = mid - 1
        return r


